import React from 'react';
import Slider from 'rc-slider';
import 'rc-slider/assets/index.css';

function TestSlider() {
	return (
		<>
			<div className='col-6'>
				<Slider
					vertical
					min={0}
					max={100}
					step={1}
					defaultValue={0}
					onChange={(value) =>
						setItemData({
							...itemData,
							quantityRemaining: value,
						})
					}
				/>
			</div>
		</>
	);
}

export default TestSlider;
